import React from "react";
import { useState } from "react";
import '../style.css';
import * as color from '../colors.js';
import { borderColor } from "@mui/system";
function Dashboard(){
    return(
        <>
        <div style={{
            width:"100%"
        }}>
            <div>
                <h2 style={{marginTop:"0",color:color.contrast}}>DASHBOARD</h2>
            </div>
            <div style={{
                margin:"auto",
                marginTop:"2em"
            }}>
                <table style={{
                    margin:"auto",
                    width:"70%",
                    borderSpacing:"0"
                }}>
                    <tr>
                        <th className="th">
                            Item
                        </th>
                        <th className="th">
                            Units
                        </th>
                    </tr>
                    <tr>
                        <td className="td">
                            Pen
                        </td>
                        <td className="td">
                            100
                        </td>
                    </tr>
                </table>
            </div>
        </div>
        </>
    );
    
}
export default Dashboard;
